const items = $input.all();

function extractText(obj) {
  // Your input format: item.json[0][0].content[0].text
  if (Array.isArray(obj)) {
    // find first message-like object inside nested arrays
    for (const a of obj) {
      const t = extractText(a);
      if (t) return t;
    }
    return null;
  }

  // direct message object
  if (obj?.content?.[0]?.text) return obj.content[0].text;

  // sometimes it's wrapped deeper
  for (const k of Object.keys(obj || {})) {
    const v = obj[k];
    const t = extractText(v);
    if (t) return t;
  }

  return null;
}

return items.map((item) => {
  const root = item.json;

  const text = extractText(root);
  if (!text) throw new Error("Could not find content[0].text in input item.");

  let s = String(text).trim();

  // remove markdown code fences if ever present
  s = s.replace(/^\s*```(?:json)?\s*/i, "").replace(/\s*```\s*$/i, "").trim();

  // Extract first JSON object block
  const start = s.indexOf("{");
  const end = s.lastIndexOf("}");
  if (start === -1 || end === -1 || end <= start) {
    throw new Error("Could not locate JSON object braces in the text.");
  }
  s = s.slice(start, end + 1);

  // Parse JSON (handles escaped newlines etc.)
  let data;
  try {
    data = JSON.parse(s);
  } catch (e) {
    const fixed = s.replace(/\\n/g, "\n").replace(/\\"/g, '"');
    data = JSON.parse(fixed);
  }

  return { json: data };
});

